import { Component } from "react";
class Cl  extends Component
{
    constructor(props){
    super(props);
    this.props=props;
    
    }
    buttonclick=()=>{
        alert(this.props)
    }

    render(){
        return(
         <>
         <i>{this.props.name}sachin mahajan</i>
         <button onClick={this.buttonclick}>Click</button>
         </>
        )
    }
}      
export default Cl
